description:
I am an easy man to be gifted: good music or a good book it's ok! So, sometimes, I receive some real good things, like this Stan Getz gem!
But, it is not a usual plastic jewel case. Instead, the two cd's are packed in cardboard box, the first cd opening on the left, second on the right and in the middle there is a very good 20 pages booklet. So the artwork is hard to scan, yet there is front, back, the cd's and the booklet. So if you know &quot;The Sound&quot; enjoy and if you don't, dl it and read the booklet while listening and you will realise why Stan Getz was nicknamed &quot;The Sound&quot;

Brought to you by TQMP. (The Quality Music Project)

In this project we, fellow pirates share only quality items out of our CD collections in lossless FLAC and include covers, especially for those who like to burn and print and put it in a nice and shiny jewelcase. Well, you all know the drill :)

Ripped by Exact Audio Copy V0.99 from 01-23-2008, encoded to FLAC with 1024kb/s
